  <script>
  
  import Modal from "../Modal.vue";
  import ConfirmButton from "../../Buttons/FilledButton.vue";
  import CancelButton from "../../Buttons/OutlineButton.vue";
  import UpdateModal from "../UpdateModal.vue";
    


  export default {
    name: 'Confirmation',
    data() {
      return {
        isUpdated: false
      }
    },
    props: {
      text: String
    },
    components: {
      Modal,
      ConfirmButton,
      CancelButton,
      UpdateModal
    },
    methods:{
       closeModal(){ 
        this.isUpdated = false;
        this.$emit('close');
      },
       update(){
         this.isUpdated = true;
       }
    },
  };
  </script>
  
  <style>
    #confirm-info{
        padding-top: 10%;
        padding-bottom: 10%;
        background-color: text-primary;
    }

  </style>
  